interface Props {
  innerText: string;
  className: string;
  type: string;
  id: string;
}

export default function Field({
  innerText,
  className,
  type,
  id,
  ...props
}: Props) {
  console.log(props);

  return (
    <div>
      <label htmlFor={id}>{innerText}</label>
      <input className={className} id={id} type={type} {...props} />
    </div>
  );
}
